class Solution:
    def createSortedArray(self, instructions:list) -> int:
        sortedArray = []
        sortedArray.append(instructions[0])
        result = 0
        for num in instructions[1:]:
            l = len(sortedArray)
            i = 0
            j = l - 1
            count = 0
            for _ in range(l):
                if num <= sortedArray[i]:
                    sortedArray.insert(i, num)
                    result += count
                    break
                if num >= sortedArray[j]:
                    sortedArray.insert(j+1, num)
                    result += count
                    break
                i += 1
                j -= 1
                count += 1
        return result

solution = Solution()
print(solution.createSortedArray([1,3,3,3,2,4,2,1,2]))
